import './Login-Regis.css';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const RegisterPage = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        password: '',
        confirmPassword: ''
    });
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
        setLoading(true);

        // Basic validation
        if (formData.password !== formData.confirmPassword) {
            setError("Passwords don't match");
            setLoading(false);
            return;
        }

        try {
            const response = await fetch('http://localhost:5255/api/register-user', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    name: formData.name,
                    email: formData.email,
                    password: formData.password,
                    role: "User", // Default role for registered users
                    createdAt: new Date()
                })
            });

            const data = await response.json();

            if (response.ok) {
                // Registration successful
                alert("Registration successful!");
                navigate('/login'); // Redirect to login page
            } else {
                // Registration failed
                setError(data.message || "Registration failed");
            }
        } catch (error) {
            setError("Network error: " + error.message);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className='RegisterPage_Left'>
            <img src="/Images/MainLogo.png" alt='Main Logo' className='MainLogo' />
            <div className="nav-links">
                <Link to="/register">Register Page</Link>
                <Link to="/login">Login Page</Link>
            </div>
            
            {error && <div className="error-message">{error}</div>}
            
            <form onSubmit={handleSubmit} className='RegisterForm'>
                <h3>Welcome Aboard, Fubbies</h3>
                <h6>Fill in your details to continue your journey with us!</h6>
                
                <label htmlFor="name">Name</label>
                <div>
                    <input 
                        type="text" 
                        id="name"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        placeholder='Enter Your Name' 
                        required
                    />
                </div>
                
                <label htmlFor="email">Email</label>
                <div>
                    <input 
                        type="email" 
                        id="email"
                        name="email"
                        value={formData.email}
                        onChange={handleChange}
                        placeholder='Enter Your Email Address' 
                        required
                    />
                </div>
                
                <label htmlFor="password">Password</label>
                <div>
                    <input 
                        type="password" 
                        id="password"
                        name="password"
                        value={formData.password}
                        onChange={handleChange}
                        placeholder='Enter Your Password' 
                        required
                    />
                </div>
                
                <label htmlFor="confirmPassword">Confirm Password</label>
                <div>
                    <input 
                        type="password" 
                        id="confirmPassword"
                        name="confirmPassword"
                        value={formData.confirmPassword}
                        onChange={handleChange}
                        placeholder='Confirm Your Password' 
                        required
                    />
                </div>
                
                <div>
                    <button type="submit" disabled={loading}>
                        {loading ? 'Signing Up...' : 'Sign Up'}
                    </button>
                </div>
                
                <div>
                    <label>Already have an account? </label>
                    <Link to="/login">Login Here</Link>
                </div>
            </form>
        </div>
    );
};

export default RegisterPage;
